import React, {useState} from 'react';

const AreaNuevaNota = () => {
    //State de los input ingresados ne la nueva nota
    const [input, setInput] = useState({
        titulo: '',
        contenido: ''
    });
    
    return ( 
        <div>
            <form>
                <input className="tituloNuevaNota" name="titulo" placeholder="Titulo" />
                <textarea name="contenido" placeholder="Escriba una nota..." rows="3" />
                <button>Agregar</button>
            </form>
        </div>
    );
}
 
export default AreaNuevaNota;
